import React from "react"
import cs from "./Contact.module.css"

const Contact = (props) =>{

    return <span className={cs.contact}>
        {props.ContactValue &&
        <div >
        {props.ContactName} : {props.ContactValue}
        </div>
        }
    </span>
}


export default Contact
